import './_app';

export default function Home() {
	return (
		<div>
			<p>Home Page</p>
			<div className="columns">
			  <div className="column">1</div>
			  <div className="column">2</div>
			  <div className="column">3</div>
			  <div className="column">4</div>
			  <div className="column">5</div>
			</div>
		</div>
	);
};
